import {useState} from 'react';

function App(){
  let todos=["Apple","Banana"];
  return(
    <>
    <ul>
      todos.map((item) => {
        <div>
          <input type='checkbox' />
          <li key={item}>"Learn "+{item}</li>
        </div>
      })
    </ul>
    </>
  )
}

export default App;
